import{_ as a,c as e,o as t,a as n,b as s,e as o}from"./app.14440598.js";const f=`{"title":"Rabbit MQ","description":"","frontmatter":{"slug":"rabbit-mq","title":"Rabbit MQ"},"headers":[{"level":2,"title":"Getting Started","slug":"getting-started"},{"level":2,"title":"ServiceStack.RabbitMq","slug":"servicestack-rabbitmq"},{"level":3,"title":"POCO Messages","slug":"poco-messages"},{"level":3,"title":"Registering Message Handlers","slug":"registering-message-handlers"},{"level":3,"title":"Starting the Rabbit MQ Server","slug":"starting-the-rabbit-mq-server"},{"level":3,"title":"Allocating multiple threads for specific operations","slug":"allocating-multiple-threads-for-specific-operations"},{"level":3,"title":"Publishing messages","slug":"publishing-messages"},{"level":2,"title":"Message Workflow","slug":"message-workflow"},{"level":3,"title":"Messages with no responses are sent to '.outq' Topic","slug":"messages-with-no-responses-are-sent-to-outq-topic"},{"level":3,"title":"Messages with Responses are published to the Response .inq","slug":"messages-with-responses-are-published-to-the-response-inq"},{"level":3,"title":"Responses from Messages with ReplyTo are published to that address","slug":"responses-from-messages-with-replyto-are-published-to-that-address"},{"level":3,"title":"Messages that generate exceptions can be re-tried, then published to the dead-letter-queue (.dlq)","slug":"messages-that-generate-exceptions-can-be-re-tried-then-published-to-the-dead-letter-queue-dlq"},{"level":2,"title":"Adding Rabbit MQ support to ServiceStack","slug":"adding-rabbit-mq-support-to-servicestack"},{"level":3,"title":"Process ServiceStack MQ Services without a HTTP host","slug":"process-servicestack-mq-services-without-a-http-host"},{"level":3,"title":"Rabbit MQ Filters","slug":"rabbit-mq-filters"},{"level":2,"title":"Rabbit MQ Features","slug":"rabbit-mq-features"}],"relativePath":"rabbit-mq.md","lastUpdated":1634495308426}`,p={},c=n('',7),l=s("div",{class:"package-reference-box"},[s("div",{class:"flex"},[s("div",{class:"flex-grow pre-container",style:{background:"#002440"}},[s("pre",{class:"sh copy m-0 p-0 pl-2 py-1 align-middle",style:{background:"#002440"}},[s("p",null,[s("code",null,'<PackageReference Include="ServiceStack.RabbitMq" Version="5.*" />')]),o(`
`)])]),s("div",{class:"flex-shrink"},[s("i",{class:"svg-copy inline-block w-8 h-full",title:"copy",onclick:"copy(this)"}),s("b")])]),s("div",{class:"copy-text w-full text-right h-6"})],-1),i=n(`__VP_STATIC_START__<h4 id="rabbitmqserver" tabindex="-1">RabbitMqServer <a class="header-anchor" href="#rabbitmqserver" aria-hidden="true">#</a></h4><p>The package includes <strong>RabbitMqServer</strong>, the Rabbit MQ implementation of ServiceStack&#39;s MQ <a href="https://github.com/ServiceStack/ServiceStack/blob/master/src/ServiceStack.Interfaces/Messaging/IMessageService.cs" target="_blank" rel="noopener noreferrer">IMessageService</a> Server API.</p><p>RabbitMqServer is basically a high-level POCO-based MQ server library that&#39;s de-coupled and can operate independently from the ServiceStack web framework. Given this, we&#39;re able to learn its functionality by exploring the library on its own. By default, RabbitMqServer looks for a Rabbit MQ Server instance on <strong>localhost</strong> at Rabbit MQ&#39;s default port <strong>5672</strong>:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>Which is equivalent to these other configurations:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span><span class="token string">&quot;localhost&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span><span class="token string">&quot;localhost:5672&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span><span class="token string">&quot;amqp://localhost:5672&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>More connection strings examples are available on <a href="http://www.rabbitmq.com/uri-spec.html" target="_blank" rel="noopener noreferrer">Rabbit MQ&#39;s URI Specification</a> page.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Run-able examples of these code-samples are available in the <a href="https://github.com/ServiceStack/ServiceStack/blob/master/tests/ServiceStack.Server.Tests/Messaging/MqServerIntroTests.cs" target="_blank" rel="noopener noreferrer">RabbitMqServerIntroTests</a></p></div><h4 id="message-filters" tabindex="-1">Message Filters <a class="header-anchor" href="#message-filters" aria-hidden="true">#</a></h4><p>There are optional <code>PublishMessageFilter</code> and <code>GetMessageFilter</code> callbacks which can be used to intercept outgoing and incoming messages. The Type name of the message body that was published is available in <code>IBasicProperties.Type</code>, e.g:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span><span class="token string">&quot;localhost&quot;</span><span class="token punctuation">)</span> 
<span class="token punctuation">{</span>
    PublishMessageFilter <span class="token operator">=</span> <span class="token punctuation">(</span>queueName<span class="token punctuation">,</span> properties<span class="token punctuation">,</span> msg<span class="token punctuation">)</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>
        properties<span class="token punctuation">.</span>AppId <span class="token operator">=</span> <span class="token interpolation-string"><span class="token string">$&quot;app:</span><span class="token interpolation"><span class="token punctuation">{</span><span class="token expression language-csharp">queueName</span><span class="token punctuation">}</span></span><span class="token string">&quot;</span></span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span><span class="token punctuation">,</span>
    GetMessageFilter <span class="token operator">=</span> <span class="token punctuation">(</span>queueName<span class="token punctuation">,</span> basicMsg<span class="token punctuation">)</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>
        <span class="token class-name"><span class="token keyword">var</span></span> props <span class="token operator">=</span> basicMsg<span class="token punctuation">.</span>BasicProperties<span class="token punctuation">;</span>
        receivedMsgType <span class="token operator">=</span> props<span class="token punctuation">.</span>Type<span class="token punctuation">;</span> <span class="token comment">//automatically added by RabbitMqProducer</span>
        receivedMsgApp <span class="token operator">=</span> props<span class="token punctuation">.</span>AppId<span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span><span class="token punctuation">;</span>

<span class="token keyword">using</span> <span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">var</span></span> mqClient <span class="token operator">=</span> mqServer<span class="token punctuation">.</span><span class="token function">CreateMessageQueueClient</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span>
<span class="token punctuation">{</span>
    mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;Bugs Bunny&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>

receivedMsgApp<span class="token punctuation">.</span><span class="token function">Print</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>   <span class="token comment">// app:mq:Hello.In</span>
receivedMsgType<span class="token punctuation">.</span><span class="token function">Print</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>  <span class="token comment">// Hello</span>
</code></pre></div><h3 id="poco-messages" tabindex="-1">POCO Messages <a class="header-anchor" href="#poco-messages" aria-hidden="true">#</a></h3><p>Just like the rest of ServiceStack, you can use any POCO for your messages (aka Request DTOs) which are serialized with ServiceStack&#39;s JSON Serializer and embedded as the body payload, a simple example is just:</p><div class="language-csharp"><pre><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">Hello</span>
<span class="token punctuation">{</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">string</span></span> Name <span class="token punctuation">{</span> <span class="token keyword">get</span><span class="token punctuation">;</span> <span class="token keyword">set</span><span class="token punctuation">;</span> <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><h3 id="registering-message-handlers" tabindex="-1">Registering Message Handlers <a class="header-anchor" href="#registering-message-handlers" aria-hidden="true">#</a></h3><p>Now that we have a message we can use, we can start listening to any of these messages sent via the broker by registering handlers for it. Here&#39;s how to register a simple handler that just prints out each message it receieves:</p><div class="language-csharp"><pre><code>mqServer<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">RegisterHandler</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>m <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>
    <span class="token class-name">Hello</span> request <span class="token operator">=</span> m<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token string">&quot;Hello, {0}!&quot;</span><span class="token punctuation">.</span><span class="token function">Print</span><span class="token punctuation">(</span>request<span class="token punctuation">.</span>Name<span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token keyword">return</span> <span class="token keyword">null</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>Each handler receives an <a href="https://github.com/ServiceStack/ServiceStack/blob/master/src/ServiceStack.Interfaces/Messaging/IMessage.cs" target="_blank" rel="noopener noreferrer">IMessage</a> which is just the body of the message that was sent (i.e. <code>T</code>) wrapped inside an <code>IMessage</code> container containing the metadata of the received message. Inside your handler you can use <code>IMessage.GetBody()</code> to extract the typed body, and in this case we signify the service has no response by returning <code>null</code>.</p><h3 id="starting-the-rabbit-mq-server" tabindex="-1">Starting the Rabbit MQ Server <a class="header-anchor" href="#starting-the-rabbit-mq-server" aria-hidden="true">#</a></h3><p>Once all your handlers are registered you can start listening to messages by starting the MQ Server:</p><div class="language-csharp"><pre><code>mqServer<span class="token punctuation">.</span><span class="token function">Start</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>Starting the MQ Server spawns 2 threads for each handler, one to listen to the Message Inbox <code>mq:Hello.inq</code> and another to listen on the Priority Queue located at <code>mq:Hello.priorityq</code>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>You can white-list which messages to enable Priority Queue&#39;s for with <code>mqServer.PriorityQueuesWhitelist</code> or disable them all by setting <code>mqServer.DisablePriorityQueues = true</code>.</p></div><h3 id="allocating-multiple-threads-for-specific-operations" tabindex="-1">Allocating multiple threads for specific operations <a class="header-anchor" href="#allocating-multiple-threads-for-specific-operations" aria-hidden="true">#</a></h3><p>By default only 1 thread is allocated to handle each message type, but this is easily configurable at registration. E.g. you can spawn 4 threads to handle a CPU-intensive operation with:</p><div class="language-csharp"><pre><code>mqServer<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">RegisterHandler</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>m <span class="token operator">=&gt;</span> <span class="token punctuation">{</span> <span class="token range operator">..</span> <span class="token punctuation">}</span><span class="token punctuation">,</span> <span class="token named-parameter punctuation">noOfThreads</span><span class="token punctuation">:</span><span class="token number">4</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><h3 id="publishing-messages" tabindex="-1">Publishing messages <a class="header-anchor" href="#publishing-messages" aria-hidden="true">#</a></h3><p>With the mqServer started, you&#39;re now ready to start publishing messages, you can do with a message queue client that you can get from a new <strong>RabbitMqMessageFactory</strong> or the mqServer directly, e.g:</p><div class="language-csharp"><pre><code><span class="token keyword">using</span> <span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">var</span></span> mqClient <span class="token operator">=</span> mqServer<span class="token punctuation">.</span><span class="token function">CreateMessageQueueClient</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span>
<span class="token punctuation">{</span>
    mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;World&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre></div><p>The above shows the most common usage where you can publish POCO&#39;s directly, behind the scenes this gets serialized as JSON and embedded as the payload of a new persistent message that&#39;s sent using a <strong>routing key</strong> of the same name as the destination queue which by convention is mapped 1:1 to a queue of the same name, i.e: <strong>mq:Hello.inq</strong>. In effect, publishing messages are sent to a distinct <strong>Inbox Queue</strong> that&#39;s reserved for each message type, essentially behaving as a work queue.</p><h2 id="message-workflow" tabindex="-1">Message Workflow <a class="header-anchor" href="#message-workflow" aria-hidden="true">#</a></h2><p>By default, RabbitMqServer will send a response message after it&#39;s processed each message, what the response is and which Queue (or HTTP url) the response is published to is dependent on the outcome of the message handler, i.e:</p><p><img src="https://docs.google.com/drawings/d/1gsyhAyVxJg37tFlHX1CfwH88OX8Mkt8nTlAIOae1_x0/pub?w=1033&amp;h=653" alt="Rabbit MQ Flowchart"></p><h3 id="messages-with-no-responses-are-sent-to-outq-topic" tabindex="-1">Messages with no responses are sent to &#39;.outq&#39; Topic <a class="header-anchor" href="#messages-with-no-responses-are-sent-to-outq-topic" aria-hidden="true">#</a></h3><p>When a handler returns a <code>null</code> response, the incoming message is re-published as a &quot;transient&quot; message to the out queue, e.g: <code>mq:Hello.outq</code> via the Rabbit MQ &quot;fanout&quot; exchange <code>mx.servicestack.topic</code> having the effect of notifying any subscribers to <code>mq:Hello.outq</code> each time a message is processed.</p><p>We can use this behavior to block until a message gets processed with:</p><div class="language-csharp"><pre><code><span class="token class-name">IMessage<span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span> msgCopy <span class="token operator">=</span> mqClient<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Get</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>QueueNames<span class="token operator">&lt;</span>Hello<span class="token operator">&gt;</span><span class="token punctuation">.</span>Out<span class="token punctuation">)</span><span class="token punctuation">;</span>
mqClient<span class="token punctuation">.</span><span class="token function">Ack</span><span class="token punctuation">(</span>msgCopy<span class="token punctuation">)</span><span class="token punctuation">;</span>
msgCopy<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Name <span class="token comment">//= World</span>
</code></pre></div><p>Also shown in this example is an explicit <strong>Ack</strong> (which should be done for each message you receive) to tell Rabbit MQ that you&#39;ve taken responsibility of the message so it can safely remove it off the queue.</p><h3 id="messages-with-responses-are-published-to-the-response-inq" tabindex="-1">Messages with Responses are published to the Response .inq <a class="header-anchor" href="#messages-with-responses-are-published-to-the-response-inq" aria-hidden="true">#</a></h3><p>Often message handlers will just return a POCO response after it processes a message, e.g:</p><div class="language-csharp"><pre><code>mqServer<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">RegisterHandler</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>m <span class="token operator">=&gt;</span>
    <span class="token keyword">new</span> <span class="token constructor-invocation class-name">HelloResponse</span> <span class="token punctuation">{</span> Result <span class="token operator">=</span> <span class="token interpolation-string"><span class="token string">$&quot;Hello, </span><span class="token interpolation"><span class="token punctuation">{</span><span class="token expression language-csharp">m<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Name</span><span class="token punctuation">}</span></span><span class="token string">!&quot;</span></span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>Whenever there&#39;s a response, then instead of the .outq the response message is sent to the <strong>.inq</strong> of the response message type, which for a <code>HelloResponse</code> type is just <strong>mq:HelloResponse.inq</strong>, e.g:</p><div class="language-csharp"><pre><code>mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;World&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token class-name"><span class="token keyword">var</span></span> responseMsg <span class="token operator">=</span> mqClient<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Get</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>HelloResponse<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>QueueNames<span class="token operator">&lt;</span>HelloResponse<span class="token operator">&gt;</span><span class="token punctuation">.</span>In<span class="token punctuation">)</span><span class="token punctuation">;</span>
mqClient<span class="token punctuation">.</span><span class="token function">Ack</span><span class="token punctuation">(</span>responseMsg<span class="token punctuation">)</span><span class="token punctuation">;</span>
responseMsg<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Result <span class="token comment">//= Hello, World!</span>
</code></pre></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>this behavior can be limited to only publish responses for types in the <code>mqServer.PublishResponsesWhitelist</code>, otherwise all response messages can be disabled entirely by setting <code>mqServer.DisablePublishingResponses = true</code>.</p></div><h3 id="responses-from-messages-with-replyto-are-published-to-that-address" tabindex="-1">Responses from Messages with ReplyTo are published to that address <a class="header-anchor" href="#responses-from-messages-with-replyto-are-published-to-that-address" aria-hidden="true">#</a></h3><p>Whilst for the most part you&#39;ll only need to publish POCO messages, you can also alter the default behavior by providing a customized <code>IMessage&lt;T&gt;</code> wrapper which ServiceStack will send instead, e.g. you can specify your own <strong>ReplyTo</strong> address to change the queue where the response gets published, e.g:</p><div class="language-csharp"><pre><code><span class="token keyword">const</span> <span class="token class-name"><span class="token keyword">string</span></span> replyToMq <span class="token operator">=</span> mqClient<span class="token punctuation">.</span><span class="token function">GetTempQueueName</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Message<span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;World&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    ReplyTo <span class="token operator">=</span> replyToMq
<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token class-name">IMessage<span class="token punctuation">&lt;</span>HelloResponse<span class="token punctuation">&gt;</span></span> responseMsg <span class="token operator">=</span> mqClient<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Get</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>HelloResponse<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>replyToMq<span class="token punctuation">)</span><span class="token punctuation">;</span>
mqClient<span class="token punctuation">.</span><span class="token function">Ack</span><span class="token punctuation">(</span>responseMsg<span class="token punctuation">)</span><span class="token punctuation">;</span>
responseMsg<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Result <span class="token comment">//= Hello, World!</span>
</code></pre></div><h4 id="replyto-addresses-can-be-urls" tabindex="-1">ReplyTo addresses can be URLs <a class="header-anchor" href="#replyto-addresses-can-be-urls" aria-hidden="true">#</a></h4><p>A nice feature unique in ServiceStack is that the ReplyTo address can even be a <strong>HTTP Uri</strong>, in which case ServiceStack will attempt to <strong>POST</strong> the raw response at that address. This works nicely with ServiceStack Services which excel at accepting serialized DTO&#39;s.</p><div class="language-csharp"><pre><code>mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Message<span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;World&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>
    ReplyTo <span class="token operator">=</span> <span class="token string">&quot;http://example.org/hello/callback&quot;</span>
<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><h3 id="messages-that-generate-exceptions-can-be-re-tried-then-published-to-the-dead-letter-queue-dlq" tabindex="-1">Messages that generate exceptions can be re-tried, then published to the dead-letter-queue (.dlq) <a class="header-anchor" href="#messages-that-generate-exceptions-can-be-re-tried-then-published-to-the-dead-letter-queue-dlq" aria-hidden="true">#</a></h3><p>By default Rabbit Mq Server lets you specify whether or not you want messages that cause an exception to be retried by specifying a RetryCount of 1 (default), or if you don&#39;t want any messages re-tried, specify a value of 0, e.g:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span> <span class="token punctuation">{</span> RetryCount <span class="token operator">=</span> <span class="token number">1</span> <span class="token punctuation">}</span><span class="token punctuation">;</span>
</code></pre></div><p>To illustrate how this works we&#39;ll keep a counter of how many times a message handler is invoked, then throw an exception to force an error condition, e.g:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> called <span class="token operator">=</span> <span class="token number">0</span><span class="token punctuation">;</span>
mqServer<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">RegisterHandler</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>m <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>
    called<span class="token operator">++</span><span class="token punctuation">;</span>
    <span class="token keyword">throw</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">ArgumentException</span><span class="token punctuation">(</span><span class="token string">&quot;Name&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>Now when we publish a message the response instead gets published to the messages <strong>.dlq</strong>, after it&#39;s first transparently retried. We can verify this behavior by checking <code>called=2</code>:</p><div class="language-csharp"><pre><code>mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;World&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token class-name">IMessage<span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span> dlqMsg <span class="token operator">=</span> mqClient<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Get</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>QueueNames<span class="token operator">&lt;</span>Hello<span class="token operator">&gt;</span><span class="token punctuation">.</span>Dlq<span class="token punctuation">)</span><span class="token punctuation">;</span>
mqClient<span class="token punctuation">.</span><span class="token function">Ack</span><span class="token punctuation">(</span>dlqMsg<span class="token punctuation">)</span><span class="token punctuation">;</span>

Assert<span class="token punctuation">.</span><span class="token function">That</span><span class="token punctuation">(</span>called<span class="token punctuation">,</span> Is<span class="token punctuation">.</span><span class="token function">EqualTo</span><span class="token punctuation">(</span><span class="token number">2</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>DLQ Messages retains the original message in their body as well as the last exception serialized in the <code>IMessage.Error</code> ResponseStatus metadata property, e.g:</p><div class="language-csharp"><pre><code>dlqMsg<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Name   <span class="token comment">//= World</span>
dlqMsg<span class="token punctuation">.</span>Error<span class="token punctuation">.</span>ErrorCode  <span class="token comment">//= typeof(ArgumentException).Name</span>
dlqMsg<span class="token punctuation">.</span>Error<span class="token punctuation">.</span>Message    <span class="token comment">//= Name</span>
</code></pre></div><p>Since the body of the original message is left in-tact, you&#39;re able to retry failed messages by removing them from the dead-letter-queue then re-publishing the original message, e.g:</p><div class="language-csharp"><pre><code><span class="token class-name">IMessage<span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span> dlqMsg <span class="token operator">=</span> mqClient<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Get</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>QueueNames<span class="token operator">&lt;</span>Hello<span class="token operator">&gt;</span><span class="token punctuation">.</span>Dlq<span class="token punctuation">)</span><span class="token punctuation">;</span>

mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span>dlqMsg<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

mqClient<span class="token punctuation">.</span><span class="token function">Ack</span><span class="token punctuation">(</span>dlqMsg<span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><p>This is useful for recovering failed messages after identifying and fixing bugs that were previously causing exceptions, where you can replay and re-process DLQ messages and continue processing them as normal.</p><h2 id="adding-rabbit-mq-support-to-servicestack" tabindex="-1">Adding Rabbit MQ support to ServiceStack <a class="header-anchor" href="#adding-rabbit-mq-support-to-servicestack" aria-hidden="true">#</a></h2><p>Whilst <code>RabbitMqServer</code> is useful on its own, it also has the distinct advantage of being able to directly Execute ServiceStack Services which you can do by just routing the handler for each <strong>Request DTO</strong> you want to process through to ServiceStack&#39;s AppHost <strong>ExecuteMessage</strong>, e.g:</p><div class="language-csharp"><pre><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">AppHost</span> <span class="token punctuation">:</span> <span class="token type-list"><span class="token class-name">AppHostHttpListenerBase</span></span>
<span class="token punctuation">{</span>
    <span class="token keyword">public</span> <span class="token function">AppHost</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">:</span> <span class="token keyword">base</span><span class="token punctuation">(</span><span class="token string">&quot;Rabbit MQ Test Host&quot;</span><span class="token punctuation">,</span> <span class="token keyword">typeof</span><span class="token punctuation">(</span><span class="token type-expression class-name">HelloService</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Assembly<span class="token punctuation">)</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>

    <span class="token keyword">public</span> <span class="token keyword">override</span> <span class="token return-type class-name"><span class="token keyword">void</span></span> <span class="token function">Configure</span><span class="token punctuation">(</span><span class="token class-name">Container</span> container<span class="token punctuation">)</span>
    <span class="token punctuation">{</span>
        container<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Register</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>IMessageService<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>c <span class="token operator">=&gt;</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

        <span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> container<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Resolve</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>IMessageService<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

        mqServer<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">RegisterHandler</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>ExecuteMessage<span class="token punctuation">)</span><span class="token punctuation">;</span>
        mqServer<span class="token punctuation">.</span><span class="token function">Start</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><p>Now each message will instead be executed by the best matching ServiceStack Service that handles the message with either a <strong>Post</strong> or <strong>Any</strong> fallback verb, e.g:</p><div class="language-csharp"><pre><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">HelloService</span> <span class="token punctuation">:</span> <span class="token type-list"><span class="token class-name">Service</span></span>
<span class="token punctuation">{</span>
    <span class="token keyword">public</span> <span class="token return-type class-name"><span class="token keyword">object</span></span> <span class="token function">Any</span><span class="token punctuation">(</span><span class="token class-name">Hello</span> request<span class="token punctuation">)</span>
    <span class="token punctuation">{</span>
        <span class="token keyword">return</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">HelloResponse</span> <span class="token punctuation">{</span> Result <span class="token operator">=</span> <span class="token interpolation-string"><span class="token string">$&quot;Hello, </span><span class="token interpolation"><span class="token punctuation">{</span><span class="token expression language-csharp">request<span class="token punctuation">.</span>Name</span><span class="token punctuation">}</span></span><span class="token string">!&quot;</span></span> <span class="token punctuation">}</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span>
</code></pre></div><p>In addition to executing your service implementation, all Services processed via a MQ Server goes through ServiceStack&#39;s standard <a href="/order-of-operations.html#wiki-mq-non-http-custom-hooks">MQ Request Pipeline</a>.</p><p>With everything in place, initialize ServiceStack&#39;s AppHost to start the Rabbit MQ Server to listen for any messages published to the Request DTO&#39;s <strong>.inq</strong>:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> appHost <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">AppHost</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">Init</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token keyword">using</span> <span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">var</span></span> mqClient <span class="token operator">=</span> appHost<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Resolve</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>IMessageService<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">CreateMessageQueueClient</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span>
<span class="token punctuation">{</span>
    mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;World&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

    <span class="token class-name"><span class="token keyword">var</span></span> responseMsg <span class="token operator">=</span> mqClient<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Get</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>HelloResponse<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>QueueNames<span class="token operator">&lt;</span>HelloResponse<span class="token operator">&gt;</span><span class="token punctuation">.</span>In<span class="token punctuation">)</span><span class="token punctuation">;</span>
    mqClient<span class="token punctuation">.</span><span class="token function">Ack</span><span class="token punctuation">(</span>responseMsg<span class="token punctuation">)</span><span class="token punctuation">;</span>
    responseMsg<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Result <span class="token comment">//= Hello, World!     </span>
<span class="token punctuation">}</span>
</code></pre></div><h3 id="process-servicestack-mq-services-without-a-http-host" tabindex="-1">Process ServiceStack MQ Services without a HTTP host <a class="header-anchor" href="#process-servicestack-mq-services-without-a-http-host" aria-hidden="true">#</a></h3><p>Whilst it&#39;s unlikely to be a common use-case, you can even run a ServiceStack MQ Server without a HTTP host by configuring the mqServer inside the generic BasicAppHost, e.g:</p><div class="language-csharp"><pre><code><span class="token class-name"><span class="token keyword">var</span></span> appHost <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">BasicAppHost</span><span class="token punctuation">(</span><span class="token keyword">typeof</span><span class="token punctuation">(</span><span class="token type-expression class-name">HelloService</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Assembly<span class="token punctuation">)</span> <span class="token punctuation">{</span>
    ConfigureAppHost <span class="token operator">=</span> host <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>
        host<span class="token punctuation">.</span>Container<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Register</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>IMessageService<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>c <span class="token operator">=&gt;</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

        <span class="token class-name"><span class="token keyword">var</span></span> mqServer <span class="token operator">=</span> host<span class="token punctuation">.</span>Container<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Resolve</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>IMessageService<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

        mqServer<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">RegisterHandler</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>Hello<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>host<span class="token punctuation">.</span>ExecuteMessage<span class="token punctuation">)</span><span class="token punctuation">;</span>
        mqServer<span class="token punctuation">.</span><span class="token function">Start</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span><span class="token punctuation">.</span><span class="token function">Init</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token keyword">using</span> <span class="token punctuation">(</span><span class="token class-name"><span class="token keyword">var</span></span> mqClient <span class="token operator">=</span> appHost<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Resolve</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>IMessageService<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">CreateMessageQueueClient</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">)</span>
<span class="token punctuation">{</span>
    mqClient<span class="token punctuation">.</span><span class="token function">Publish</span><span class="token punctuation">(</span><span class="token keyword">new</span> <span class="token constructor-invocation class-name">Hello</span> <span class="token punctuation">{</span> Name <span class="token operator">=</span> <span class="token string">&quot;World&quot;</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

    <span class="token class-name"><span class="token keyword">var</span></span> msg <span class="token operator">=</span> mqClient<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Get</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>HelloResponse<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>QueueNames<span class="token operator">&lt;</span>HelloResponse<span class="token operator">&gt;</span><span class="token punctuation">.</span>In<span class="token punctuation">)</span><span class="token punctuation">;</span>
    mqClient<span class="token punctuation">.</span><span class="token function">Ack</span><span class="token punctuation">(</span>msg<span class="token punctuation">)</span><span class="token punctuation">;</span>
    Assert<span class="token punctuation">.</span><span class="token function">That</span><span class="token punctuation">(</span>msg<span class="token punctuation">.</span><span class="token function">GetBody</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span>Result<span class="token punctuation">,</span> Is<span class="token punctuation">.</span><span class="token function">EqualTo</span><span class="token punctuation">(</span><span class="token string">&quot;Hello, World!&quot;</span><span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token punctuation">}</span>
</code></pre></div><p>In this way, ServiceStack&#39;s AppHost is being used as a pure &quot;logic server&quot;, hosting auto-wired services within <a href="/order-of-operations.html#wiki-mq-non-http-custom-hooks">its MQ Request Pipeline</a>, whilst taking advantage of ServiceStack&#39;s flexibility and extensibility options and its plugin ecosystem.</p><p>Run-able examples of these code-samples are available in the <a href="https://github.com/ServiceStack/ServiceStack/blob/master/tests/ServiceStack.Server.Tests/Messaging/MqServerIntroTests.cs#L13" target="_blank" rel="noopener noreferrer">RabbitMqServerIntroTests</a>.</p><h3 id="rabbit-mq-filters" tabindex="-1">Rabbit MQ Filters <a class="header-anchor" href="#rabbit-mq-filters" aria-hidden="true">#</a></h3><p>The new <code>CreateQueueFilter</code> and <code>CreateTopicFilter</code> filters let you customize what options Rabbit MQ Queue&#39;s and topics are created with. The filters can be used to <a href="https://www.rabbitmq.com/ttl.html" target="_blank" rel="noopener noreferrer">declare a queue with a custom TTL</a> and have messages automatically expire after 60 seconds with:</p><div class="language-csharp"><pre><code>container<span class="token punctuation">.</span><span class="token generic-method"><span class="token function">Register</span><span class="token generic class-name"><span class="token punctuation">&lt;</span>IMessageService<span class="token punctuation">&gt;</span></span></span><span class="token punctuation">(</span>c <span class="token operator">=&gt;</span> <span class="token keyword">new</span> <span class="token constructor-invocation class-name">RabbitMqServer</span><span class="token punctuation">(</span>ConnectionString<span class="token punctuation">)</span> <span class="token punctuation">{</span>
    CreateQueueFilter <span class="token operator">=</span> <span class="token punctuation">(</span>queueName<span class="token punctuation">,</span> args<span class="token punctuation">)</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>
        <span class="token keyword">if</span> <span class="token punctuation">(</span>queueName <span class="token operator">==</span> QueueNames<span class="token operator">&lt;</span>MyRequest<span class="token operator">&gt;</span><span class="token punctuation">.</span>In<span class="token punctuation">)</span>
            args<span class="token punctuation">[</span><span class="token string">&quot;x-message-ttl&quot;</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token number">60000</span><span class="token punctuation">;</span>
    <span class="token punctuation">}</span>
<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
</code></pre></div><h2 id="rabbit-mq-features" tabindex="-1">Rabbit MQ Features <a class="header-anchor" href="#rabbit-mq-features" aria-hidden="true">#</a></h2><p>The <a href="https://github.com/ServiceStack/ServiceStack/blob/master/src/ServiceStack.RabbitMq/RabbitMqServer.cs" target="_blank" rel="noopener noreferrer">Rabbit MQ Server</a> have some configuration options that are unique to Rabbit MQ:</p><ul><li><code>ConnectionFactory</code> <strong>ConnectionFactory</strong> - The <a href="https://github.com/mythz/rabbitmq-windows" target="_blank" rel="noopener noreferrer">RabbitMQ.Client</a> Connection factory to introspect connection properties and create low-level connections</li><li><code>bool</code> <strong>AutoReconnect</strong> - Whether Rabbit MQ should auto-retry connecting when a connection to Rabbit MQ Server instance is dropped</li><li><code>bool</code> <strong>UsePolling</strong> - Whether to use polling for consuming messages instead of a long-term subscription</li><li><code>int</code> <strong>RetryCount</strong> - How many times a message should be retried before sending to the DLQ. Valid range for Rabbit MQ: 0-1.</li></ul><p>In addition to sharing a similar architecture to <a href="/redis-mq.html">Redis MQ</a>, it also shares a number of common features:</p><ul><li><code>int?</code> <strong>KeepAliveRetryAfterMs</strong> - Wait before Starting the MQ Server after a restart</li><li><code>IMessageFactory</code> <strong>MessageFactory</strong> - The MQ Message Factory used by this MQ Server</li><li><code>Func&lt;IMessage, IMessage&gt;</code> <strong>RequestFilter</strong> - Execute global transformation or custom logic before a request is processed. Must be thread-safe.</li><li><code>Func&lt;object, object&gt;</code> <strong>ResponseFilter</strong> - Execute global transformation or custom logic on the response. Must be thread-safe.</li><li><code>Action&lt;Exception&gt;</code> <strong>ErrorHandler</strong> - Execute global error handler logic. Must be thread-safe.</li><li><code>string[]</code> <strong>PriorityQueuesWhitelist</strong> - If you only want to enable priority queue handlers (and threads) for specific msg types.</li><li><code>bool</code> <strong>DisablePriorityQueues</strong> - Don&#39;t listen on any Priority Queues</li><li><code>string[]</code> <strong>PublishResponsesWhitelist</strong> - Opt-in to only publish responses on this white list. Publishes all responses by default.</li><li><code>bool</code> <strong>DisablePublishingResponses</strong> - Don&#39;t publish any response messages</li></ul>__VP_STATIC_END__`,83),r=[c,l,i];function u(k,d,g,h,m,b){return t(),e("div",null,r)}var y=a(p,[["render",u]]);export{f as __pageData,y as default};
